import React from 'react'
import { Card } from "react-bootstrap";
import ProductsJson from "../js/data.json";

function Commissions() {
  return (
    <div class="container">
  <div class="row row-cols-2 row-cols-lg-5 g-2 g-lg-3">  
    {ProductsJson.map((data) => (
         <div class="col">
            <Card style={{ width: "18rem", border: "none" }} key={data.id}>
              <Card.Img
                variant="top"
                src={data.image}
                style={{ height: "20rem" }}
                className="mainImage"
              />
              <div className="card-block">
                <Card.Body className="text-center">
                  <h6
                   
                  >
                    {data.title}
                  </h6>
                  <Card.Text
                    style={{
                      fontSize: "0.86rem",
                      fontFamily: "FuturaPT,Arial,sans-serif",
                    }}
                  >
                    {data.price} usd
                  </Card.Text>
                </Card.Body>
              </div>
            </Card>
    </div>
         
        ))}
    
   
  </div>
</div>
  )
}

export default Commissions
